import React from "react";
import {Link} from "react-router-dom";

const a6 = () => {
    return(
        <>
            <h2>Assignment 6</h2>
            <Link to="hello">
                Hello
            </Link> | &nbsp;
            <Link to="/a6/practice">
                Practice
            </Link> | &nbsp;
            <Link to="/a6/explore">
                Build
            </Link> | &nbsp;
            <Link to="/a6/home">
                Challenge
            </Link>
        </>
    )
};

export default a6;
